strings:
"gestures_dialog" : "На "Панелі інструментів" і кнопці навігації можна використовувати жести:
  ▪ Проведіть пальцем вгору / вниз > Прокрутіть угору / вниз;
  ▪ Проведіть вліво / вправо > Перейдіть назад / вперед;
  ▪ Натисніть > Відкрити меню;
  ▪ Довге натискання > Відкрити "Швидке перемикання".
  Ви можете налаштувати жести в налаштуваннях."

"gestures_dialog" : "Auf der Toolbar und dem "Navigationsknopf" kannst du Wischegesten benutzen: 
 ▪ Nach oben/unten wischen → nach oben/unten scrollen; 
 ▪ Nach links/rchts wischen → zurück/vor im Browserverlauf; 
 ▪ Klicken → Menü öffnen; 
 ▪ Lange drücken → öffne die "Schnelleinstellungen" 
 In den Einstellungen kannst du dies ändern."

"gestures_dialog" : "Na pasku narzędziowym oraz przycisku nawigacyjnym możesz używać gestów: 
 ▪ Pociągniecie w górę/dół → przesuń widok w górę/dół; 
 ▪ Pociągnięcie w lewo/prawo → wstecz/następna strona; 
 ▪ Pacnięcie → otwarcie menu; 
 ▪ Przytrzymanie → otwarcie szybkiego menu. 
 W Preferencjach możesz przypisać inne akcje do wybranych gestów."

"gestures_dialog" : "On the toolbar and the "Navigation button" you can use gestures: 
 ▪ Swipe up/down → scroll to top/bottom; 
 ▪ Swipe left/right → navigate back/forward; 
 ▪ Tap → open the menu; 
 ▪ Long press → open "Fast toggle dialog" 
 You can configure gestures in the settings."
